import React from "react";

const CssClasses = {
    HEADER: "home__header",
    HEADER_TEXT: "home__header--text"
}

const Contact = () => {
    return (
    <div className="container contact">
        <h1>contact page</h1>
        <div>
            <img src="../assets/contact.png" alt="contact"/>
        </div>
    </div>
    );
};

export default Contact;
